.block-container {
  padding: 16px 8px;
}
.block-container .el-col {
  height: 28px;
  display: flex;
  align-items: center;
  margin-bottom: 10px;
}
.pannel-title {
  text-align: center;
  height: 32px;
  border-top: 1px solid #dce3e8;
  border-bottom: 1px solid #dce3e8;
  background: #ebeef2;
  color: #000;
  line-height: 28px;
  padding-left: 12px;
}
.resizer {
  cursor: col-resize;
  position: absolute;
  width: 10px;
  top: 0px;
  bottom: 0px;
  z-index: 99;
  &:hover {
    background-image: radial-gradient(
      ellipse at center center,
      rgba(0, 0, 0, 0.2) 0%,
      transparent 70%,
      transparent 100%
    );
    background-size: 50px 100%;
    background-position: 0px 50%;
  }
}
